commit.message:
[Makefile] New target “install-merlin”

Building this target installs the files that are used by merlin:
 -  .merlin files (.merlin);
 -  bin-annot files (.cmt, .cmti);
 -  source files (.ml, .mli).

Plug-in developpers can thus work with an “installed” version of Coq.

